webpackJsonp([53417879583753],{4956:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Nico Ballmer",date:"25 Aug 2006",slug:"/2006-08-25-nico-ballmer/",tags:"Y2006"},html:'<p>My <a href="http://nu2m.de/">employer</a> has posted a <a href="http://www.youtube.com/watch?v=LlLAiug4Onw">recruiting video</a> for web developers featuring my <a href="http://lumma.de/eintrag.php?id=2901">boss Nico</a> on YouTube. I hope developers will come <a href="http://nu2m.de/jobs/softwareentwickler/">work for us anyway</a>. (You can get by without German, and the office is in Cologne, the <em>second</em> nicest city in Germany.)</p>\n<p><object width="425" height="350"><param name="movie" value="http://www.youtube.com/v/LlLAiug4Onw" /><embed src="http://www.youtube.com/v/LlLAiug4Onw" type="application/x-shockwave-flash" width="425" height="350" /></object></p>'},next:{fields:{title:"MacBook Blue Screen",date:"24 Aug 2006",slug:"/2006-08-24-macbook-blue-screen/"}},previous:{fields:{title:"Pennant Race",date:"27 Aug 2006",slug:"/2006-08-27-pennant-race/"}}},{node:{fields:{title:"MacBook Blue Screen",date:"24 Aug 2006",slug:"/2006-08-24-macbook-blue-screen/",tags:"Y2006"},html:'<p>My MacBook wouldn\'t wake up this morning, and worse than that, it wouldn\'t even start. It would chime and get stuck on a blue screen, the default background color (nicer than Windows blue screen), similar to the problem described <a href="http://forums.macrumors.com/showthread.php?t=222380">here</a>.</p>\n<p>I started from the Install DVD, and after that the installed system started up just fine, but it was unnerving nonetheless. So <a href="http://www.scripting.com/2006/08/15.html#yesVirginiaMacsCrashToo">Macs really do crash</a>... :-)</p>'},next:{fields:{title:"Captain Christopher",date:"24 Aug 2006",slug:"/2006-08-24-captain-christopher/"}},previous:{fields:{title:"Nico Ballmer",date:"25 Aug 2006",slug:"/2006-08-25-nico-ballmer/"}}},{node:{fields:{title:"Captain Christopher",date:"24 Aug 2006",slug:"/2006-08-24-captain-christopher/",tags:"Y2006"},html:'<p><a href="http://www.flickr.com/photos/papascott/223134142/" title="Photo Sharing"><img src="http://static.flickr.com/58/223134142_b47587fa49.jpg" width="375" height="500" alt="captain christopher" /></a></p>\n<p>No, that\'s not a GPS navigation system on the dashboard, it\'s a fish locator.</p>'},next:{fields:{title:"The Captured Flea (or The Prisoner Fled)",date:"21 Aug 2006",slug:"/2006-08-21-the-captured-flea-or-the-prisoner-fled/"}},previous:{fields:{title:"MacBook Blue Screen",date:"24 Aug 2006",slug:"/2006-08-24-macbook-blue-screen/"}}}],pathPrefix:"",first:!1,last:!1,index:198,pageCount:1101}}}});
